import React, { useState } from "react";
import Ball from "../assets/images/ball-logo.svg";

function Navbar() {
    return (
        <div className="navbar">
            <img id="ball-logo" src={Ball} alt="Ball Logo" />
            <h2>Power Up</h2>
        </div>
    );
}

export default Navbar;
